import './index.css'
import {Component} from 'react'

class TodoItem extends Component {
  render() {
    const {todoDetails, deleteTodo} = this.props

    return (
      <li>
        <h1>{todoDetails.title}</h1>
        <button type="button" onClick={deleteTodo.todoDetails.id}>
          Delete
        </button>
      </li>
    )
  }
}
export default TodoItem
